  }

  render(){
    return(
      <div className={styles.mainContainer}>
        <div
          style={{
            textDecoration: 'underline', 
            fontWeight: '900', 
            width: '100%', 
            textAlign: 'center', 
            fontSize: '2rem'
          }}
        >
          State Management
        </div>
        <div
          style={{
            textDecoration: 'underline', 
            fontWeight: '900', 
            width: '100%', 
            textAlign: 'left',
            margin: '1rem', 
