            >
              -
            </div>
              <div
                style={{
                  flex: 1
                }}
              >
              </div>
              <div
                style={{
                  flex: 1
                }}
              >
                +
              </div>
          </div>
        </div>
        <div
          style={{
            textDecoration: 'underline', 
            fontWeight: '900', 
            width: '100%', 
            textAlign: 'left',
            margin: '1rem', 
            fontSize: '1.2rem'
          }}
        >
          Input Variable
        </div>
        <div
          style={{
            textDecoration: 'underline', 
            fontWeight: '900', 
            width: '100%', 
            textAlign: 'left',
            margin: '1rem', 
            fontSize: '1.2rem'
          }}
        >
          Redux
        </div>
      </div>
    );
  }
}

export default ContentStateManagement;
